import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  ArrowRight, 
  Code, 
  Cpu, 
  Shield, 
  Wifi, 
  Trophy,
  Calendar,
  Users,
  Zap,
  Terminal,
  GitBranch,
  Database,
  ChevronDown,
  Play,
  Sparkles
} from 'lucide-react';
import { CLUB_INFO, DOMAINS } from '../utils/constants';

const Home = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const techStack = [
    { name: 'Machine Learning', icon: Cpu, color: 'from-purple-500 to-pink-500' },
    { name: 'IoT', icon: Wifi, color: 'from-green-500 to-emerald-500' },
    { name: 'Blockchain', icon: Database, color: 'from-yellow-500 to-orange-500' },
    { name: 'Cyber Security', icon: Shield, color: 'from-red-500 to-rose-500' }
  ];

  const stats = [
    { number: '500+', label: 'Members', Icon: Users, delay: 0 },
    { number: '50+', label: 'Projects', Icon: GitBranch, delay: 0.1 },
    { number: '25+', label: 'Hackathons', Icon: Trophy, delay: 0.2 },
    { number: '100+', label: 'Events', Icon: Calendar, delay: 0.3 }
  ];

  const codeLines = [
    'class MIBCS {',
    '  constructor() {',
    '    this.mission = "Innovation";',
    '    this.vision = "Future Tech";',
    '    this.members = 500+;',
    '  }',
    '}'
  ];

  return (
    <div className="min-h-screen bg-gray-950 overflow-hidden">
      {/* Animated cursor follower */}
      <div 
        className="fixed w-6 h-6 bg-cyan-400/20 rounded-full pointer-events-none z-50 mix-blend-difference"
        style={{
          left: mousePosition.x - 12,
          top: mousePosition.y - 12,
          transition: 'all 0.1s ease-out'
        }}
      />

      {/* Hero Section */}
      <section className="relative min-h-screen flex items-center justify-center">
        {/* Animated background grid */}
        <div className="absolute inset-0">
          <div className="absolute inset-0 bg-gradient-to-br from-gray-950 via-gray-900 to-gray-950"></div>
          <div className="absolute inset-0 matrix-bg opacity-10"></div>

          {/* Floating particles */}
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute w-1 h-1 bg-cyan-400 rounded-full"
              initial={{ 
                x: Math.random() * window.innerWidth, 
                y: Math.random() * window.innerHeight,
                opacity: 0 
              }}
              animate={{ 
                y: [null, -100, window.innerHeight + 100],
                opacity: [0, 1, 0]
              }}
              transition={{
                duration: Math.random() * 10 + 10,
                repeat: Infinity,
                delay: Math.random() * 5
              }}
            />
          ))}
        </div>

        <div className="relative z-10 text-center max-w-6xl mx-auto px-4">
          <motion.div
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, ease: "easeOut" }}
          >
            {/* Glitch effect title */}
            <div className="relative mb-8">
              <h1 className="text-6xl md:text-8xl font-bold text-white mb-4 relative">
                <span className="relative z-10">
                  <span className="text-gradient">M</span>
                  <span className="text-gradient">I</span>
                  <span className="text-gradient">B</span>
                  <span className="text-gradient">C</span>
                  <span className="text-gradient">S</span>
                </span>
                {/* Glitch layers */}
                <span className="absolute top-0 left-0 text-cyan-400 opacity-70 animate-pulse" style={{ clipPath: 'inset(0 0 50% 0)' }}>
                  MIBCS
                </span>
                <span className="absolute top-0 left-0 text-red-400 opacity-70 animate-pulse" style={{ clipPath: 'inset(50% 0 0 0)', animationDelay: '0.1s' }}>
                  MIBCS
                </span>
              </h1>

              <motion.div
                initial={{ width: 0 }}
                animate={{ width: '100%' }}
                transition={{ duration: 2, delay: 0.5 }}
                className="h-1 bg-gradient-to-r from-cyan-400 via-blue-500 to-purple-600 mx-auto max-w-md"
              />
            </div>

            {/* Typewriter effect subtitle */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 1, duration: 1 }}
              className="mb-12"
            >
              <p className="text-xl md:text-2xl text-gray-400 mb-4 code-font">
                {'>'} Machine Learning | IoT | Blockchain | Cyber Security
              </p>
              <p className="text-lg text-gray-500 max-w-2xl mx-auto">
                Where innovation meets execution. Join the future of technology.
              </p>
            </motion.div>

            {/* Tech stack showcase */}
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 1.5, duration: 0.8 }}
              className="grid grid-cols-2 md:grid-cols-4 gap-6 mb-12 max-w-4xl mx-auto"
            >
              {techStack.map((tech, index) => {
                const Icon = tech.icon;
                return (
                  <motion.div
                    key={tech.name}
                    initial={{ opacity: 0, scale: 0.8 }}
                    animate={{ opacity: 1, scale: 1 }}
                    transition={{ delay: 2 + index * 0.1, duration: 0.5 }}
                    whileHover={{ scale: 1.05, y: -5 }}
                    className="group"
                  >
                    <div className="relative p-6 bg-gray-900/50 backdrop-blur-sm rounded-2xl border border-gray-800 hover:border-cyan-500/50 transition-all duration-300">
                      <div className={`w-12 h-12 bg-gradient-to-r ${tech.color} rounded-xl flex items-center justify-center mb-4 mx-auto group-hover:scale-110 transition-transform duration-300`}>
                        <Icon size={24} className="text-white" />
                      </div>
                      <h3 className="text-sm font-medium text-gray-300 group-hover:text-white transition-colors duration-300">
                        {tech.name}
                      </h3>

                      {/* Hover glow effect */}
                      <div className="absolute inset-0 bg-gradient-to-r from-cyan-500/10 to-blue-500/10 rounded-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
                    </div>
                  </motion.div>
                );
              })}
            </motion.div>

            {/* CTA Buttons */}
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 2.5, duration: 0.8 }}
              className="flex flex-col sm:flex-row gap-6 justify-center items-center"
            >
              <Link to="/contact" className="group relative">
                <div className="absolute -inset-1 bg-gradient-to-r from-cyan-500 to-blue-600 rounded-xl blur opacity-75 group-hover:opacity-100 transition duration-300"></div>
                <div className="relative bg-gray-950 px-8 py-4 rounded-xl flex items-center space-x-3 text-white font-medium group-hover:bg-gray-900 transition-colors duration-300">
                  <Sparkles size={20} className="text-cyan-400" />
                  <span>Join the Revolution</span>
                  <ArrowRight size={18} className="group-hover:translate-x-1 transition-transform duration-200" />
                </div>
              </Link>

              <Link to="/projects" className="group flex items-center space-x-3 text-gray-400 hover:text-cyan-400 transition-colors duration-300">
                <div className="w-12 h-12 border border-gray-700 rounded-full flex items-center justify-center group-hover:border-cyan-400 group-hover:bg-cyan-400/10 transition-all duration-300">
                  <Play size={16} className="ml-1" />
                </div>
                <span className="font-medium">Explore Projects</span>
              </Link>
            </motion.div>
          </motion.div>
        </div>

        {/* Scroll indicator */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 3, duration: 1 }}
          className="absolute bottom-8 left-1/2 transform -translate-x-1/2"
        >
          <div className="flex flex-col items-center space-y-2 text-gray-500">
            <span className="text-sm code-font">scroll</span>
            <motion.div
              animate={{ y: [0, 10, 0] }}
              transition={{ duration: 2, repeat: Infinity }}
            >
              <ChevronDown size={20} />
            </motion.div>
          </div>
        </motion.div>
      </section>

      {/* Stats Section */}
      <section className="py-20 relative">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="grid grid-cols-2 md:grid-cols-4 gap-8"
          >
            {stats.map(({ number, label, Icon, delay }, index) => (
              <motion.div
                key={label}
                initial={{ opacity: 0, y: 30 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ delay: delay, duration: 0.6 }}
                viewport={{ once: true }}
                className="text-center group"
              >
                <div className="relative mb-4">
                  <div className="w-16 h-16 bg-gradient-to-r from-cyan-500/20 to-blue-600/20 rounded-2xl flex items-center justify-center mx-auto group-hover:scale-110 transition-transform duration-300">
                    <Icon size={24} className="text-cyan-400" />
                  </div>
                  <div className="absolute inset-0 bg-gradient-to-r from-cyan-500/10 to-blue-600/10 rounded-2xl blur-xl opacity-0 group-hover:opacity-100 transition-opacity duration-300" />
                </div>
                <div className="text-3xl font-bold text-white code-font mb-2">{number}</div>
                <div className="text-gray-400 text-sm">{label}</div>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </section>

      {/* Code Preview Section */}
      <section className="py-20 bg-gray-900/30">
        <div className="container-max">
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
            <motion.div
              initial={{ opacity: 0, x: -50 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <h2 className="text-4xl font-bold text-white mb-6">
                Code the <span className="text-gradient">Future</span>
              </h2>
              <p className="text-gray-400 text-lg mb-8 leading-relaxed">
                Join a community of innovators, builders, and dreamers. From AI algorithms to blockchain protocols, 
                we're shaping tomorrow's technology today.
              </p>
              <Link to="/about" className="btn-outline">
                Learn More
              </Link>
            </motion.div>

            <motion.div
              initial={{ opacity: 0, x: 50 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
              className="relative"
            >
              <div className="bg-gray-900 rounded-2xl border border-gray-800 overflow-hidden">
                <div className="flex items-center space-x-2 px-4 py-3 bg-gray-800 border-b border-gray-700">
                  <div className="w-3 h-3 bg-red-500 rounded-full"></div>
                  <div className="w-3 h-3 bg-yellow-500 rounded-full"></div>
                  <div className="w-3 h-3 bg-green-500 rounded-full"></div>
                  <span className="text-gray-400 text-sm ml-4 code-font">mibcs.js</span>
                </div>
                <div className="p-6 code-font text-sm">
                  {codeLines.map((line, index) => (
                    <motion.div
                      key={index}
                      initial={{ opacity: 0, x: -20 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      transition={{ delay: index * 0.1, duration: 0.3 }}
                      viewport={{ once: true }}
                      className="flex items-center space-x-4 py-1"
                    >
                      <span className="text-gray-600 w-6 text-right">{index + 1}</span>
                      <span className="text-gray-300">{line}</span>
                    </motion.div>
                  ))}
                </div>
              </div>
            </motion.div>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-20">
        <div className="container-max text-center">
          <motion.div
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="max-w-3xl mx-auto"
          >
            <div className="relative">
              <div className="absolute -inset-1 bg-gradient-to-r from-cyan-500 via-blue-600 to-purple-600 rounded-3xl blur opacity-30"></div>
              <div className="relative bg-gray-900/90 backdrop-blur-xl rounded-3xl p-12 border border-gray-800">
                <Terminal size={48} className="text-cyan-400 mx-auto mb-6" />
                <h2 className="text-4xl font-bold text-white mb-6">
                  Ready to <span className="text-gradient">Build</span> the Future?
                </h2>
                <p className="text-gray-400 text-lg mb-8 leading-relaxed">
                  Join MIBCS and be part of a community that's pushing the boundaries of technology. 
                  From hackathons to research projects, your journey starts here.
                </p>
                <div className="flex flex-col sm:flex-row gap-4 justify-center">
                  <Link to="/contact" className="btn-primary">
                    Join MIBCS
                  </Link>
                  <Link to="/events" className="btn-secondary">
                    Upcoming Events
                  </Link>
                </div>
              </div>
            </div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
